54	2018-10-06 18:50:41+00	\N	Parque Três Meninas	Uso Sustentável	Área Protegida (sem categoria)		<p>&nbsp;&nbsp;&nbsp;A cultura e a história de Brasília e Samambaia são retratadas no Parque Três Meninas. O local é uma antiga fazenda construída nos anos 60, onde se destacam três pequenas casas feitas pelos antigos proprietários para suas três filhas. Em meio a esse contexto histórico-cultural, o parque, após revitalização, oferece ainda a seus visitantes pista de skate, parques infantis, quadras poliesportivas e ciclovia.</p>\n<p><br>(DECRETO N° 15.901 DE 12 DE SETEMBRO DE 1994)Ao Núcleo de Educação Ambiental, unidade vinculada a SEMATEC, caberá, em consonância com a Administração do Parque:<br>I - executar programas de educação ambiental.<br>II - articular-se com a comunidade visando a difusão dos principies de educação ambiental.<br>III - divulgar material técnico e didático voltado à transferência de conhecimento popular e científico.</p>	1	01010000204212000092A5AD415A0E48C07E4E3A51B9BC2FC0	Entrada franca	Aberto todos os dias das 7h às 18h	Samambaia	Parque Ecológico Três Meninas
9	2018-10-06 18:50:41+00	\N	Parque Ecológico dos Jequitibás	Uso Sustentável	Área Protegida (sem categoria)		<p>Abriga área de mata ripária, em sua maior parte conservada, por onde flui o Ribeirão Sobradinho. Árvores de grande porte, como o próprio Jequitibás (que nomeia o parque), somam-se a outras espécies típicas, trazendo à área grande beleza. Possui boa infraestrutura, o que torna o parque um dos mais visitados do DF.</p>\n<p><br>São objetivos do <strong>Parque Ecológico dos Jequitibás</strong>:<br>I - garantir a conservação e a proteção da fauna existente;<br>II - proteger espécies significativas da flora local, principalmente o jequitibá - Cariniana Estrelensis, árvore-símbolo da cidade de Sobradinho;<br>III - criar condições para a melhoria da qualidade das águas do Ribeirão Sobradinho;<br>IV - reservar à comunidade uma área destinada à conservação, propiciando o exercício de atividades sócio-culturais em um ambiente equilibrado;<br>V - favorecer a realização de estudos e pesquisas científicas;<br>VI - desenvolver atividades de educação ambiental;<br>VII - estimular o desenvolvimento de atividades de recreação e lazer em contato harmônico com a natureza;<br>VIII - preservar espécies vegetais visando à obtenção de material de propagação, com vistas à recuperação de áreas degradadas.<br><br>Lista das aves observadas:<br>1.Ariramba;<br>2.Baiano;<br>3.Beija-flor-tesoura;<br>4.Beija-flor-tesoura-verde;<br>5.Bem-te-vi;<br>6.Bentevizinho-de-asa-ferrugínea;<br>7.Besourinho-de-bico-vermelho;<br>8.Bico-chato-de-orelha-preta;<br>9.Choca-da-mata;<br>10.Cisqueiro-do-rio;<br>11.Ferreirinho-relógio;<br>12.Garrinchão-de-barriga-vermelha;<br>13.Gaturamo;<br>14.Gibão-de-couro;<br>15.Maracanã-pequena;<br>16.Neinei;<br>17.Periquito-de-encontro-amarelo;<br>18.Petrim;<br>19.Picapauzinho-escamoso;<br>20.Pipira-vermelha;<br>21.Risadinha;<br>22.Sabiá-branco;<br>23.Sabiá-laranjeira;<br>24.Sabiá-poca;<br>25.Saí-andorinha;<br>26.Saí-azul;<br>27.Saíra-amarela;<br>28.Saíra-de-chapéu-preto