12	2018-10-06 18:50:41+00	\N	Parque Ecológico Península Sul	Uso Sustentável	Ecológico		<p>Oferece uma das mais belas vistas do Lago Paranoá, que pode ser contemplada num passeio pela trilha que margeia o parque, além de vários piers. Vários esportes náuticos podem ser praticados, como o SUP (Stand Up Paddle) e o kite surf, pois o parque oferece adequado acesso ao Lago. Também possui um belo gramado onde é possível tomar sol ou passear, tendo como cenário a famosa Ponte JK.</p>\n<p><br>São objetivos do Parque Ecológico Península Sul (Decreto nº 24.214, de 12 de Novembro  2003):<br>I - conservar amostras dos ecossistemas naturais;<br>II - proteger paisagens naturais de beleza cênica notável, bem como atributos excepcionais de natureza geológica, geomorfológica, espeleológica e histórica;<br>III - proteger e recuperar recursos hídricos, edáficos e genéticos;<br>IV - promover a recuperação de áreas degradadas e a sua revegetação com espécies nativas;<br>V - incentivar atividades de pesquisa, estudos e monitoramento ambiental;<br>VI - estimular o desenvolvimento da educação ambiental e das atividades de recreação e lazer em contato harmônico com a natureza.<br>Parágrafo 1º- As áreas degradadas situadas no interior do Parque Ecológico Península Sul serão objeto de recuperação.<br>Parágrafo 2º- No Parque Ecológico Península Sul, é vedada qualquer atividade ou empreendimento, público ou privado, que comprometa as características naturais da área ou que coloque em risco a integridade dos ecossistemas e da biota local.</p>	1	010100002042120000A1551C5EFAEE47C080A77F9780A92FC0	Entrada franca	Aberto todos os dias das 6h às 22h	Brasília,Lago Sul	Parque Ecológico Península Sul
