70	2018-10-06 18:50:41+00	\N	Monumento Natural Dom Bosco	Uso Sustentável	Ecológico		<p>Localizado na beira do Lago Paranoá, perto da barragem, o parque oferece a seus visitantes paisagens exuberantes, além de trilhas dentro do cerrado nativo. Por possuir uma rua asfaltada bem inclinada, o local tornou-se ideal para a prática do Downhill sobre skate. Outro grande atrativo desta unidade é a Ermida Dom Bosco, tradicional monumento e ponto turístico de Brasília, que fica localizada exatamente sob o paralelo 15S, conforme o sonho do salesiano Dom Bosco, em 1883.<br>São objetivos do Parque Ecológico da Ermida Dom Bosco&nbsp;(Decreto n° 19.292, de 04 de junho de 1998):<br>I. a preservação dos atributos naturais da região, especialmente os remanescentes de vegetação nativa;<br>II – a preservação na fauna associada ao tipo de vegetação presente na área;<br>III – a recuperação das áreas degradadas pelo manejo inadequado do solo;<br>IV – proporcionar o desenvolvimento de programas de educação ambiental e de pesquisas sobre os ecossistemas locais;<br>V – proporcionar à população lazer e cultura visando principalmente o desenvolvimento de atividades que levem em conta a conservação do meio ambiente;<br>VI – promover e desenvolver atividades compatíveis com as já existentes no local.<br><br><br>Lista das aves observadas:<br>1.Alma-de-gato;<br>2.Andorinha-do-campo;<br>3.Andorinha-pequena-de-casa;<br>4.Ariramba;<br>5.Asa-branca;<br>6.Baiano;<br>7.Balança-rabo-de-máscara;<br>8.Batuqueiro;<br>9.Beija-flor-tesoura;<br>10.Bem-te-vi;<br>11.Besourinho-de-bico-vermelho;<br>12.Cambacica;<br>13.Canário-da-terra;<br>14.Carcará;<br>15.Choca-de-asa-vermelha;<br>16.Corruíra [grupo musculus;<br>17.Guaracava-de-barriga-amarela;<br>18.Guaracava-de-topete-uniforme;<br>19.João-de-barro;<br>20.João-de-pau;<br>21.Periquitão;<br>22.Periquito-de-encontro-amarelo;<br>23.Pica-pau-verde-barrado;<br>24.Quero-quero;<br>25.Quiriquiri;<br>26.Risadinha;<br>27.Rolinha;<br>28.Sabiá-do-campo;<br>29.Saíra-amarela;<