32	2018-10-06 18:50:41+00	\N	Parque Ecológico Riacho Fundo	Uso Sustentável	Ecológico		<p>&nbsp;O <strong>Parque Ecológico do Riacho Fundo </strong>corresponde à área de aproximadamente 530 hectares entre o Riacho Fundo I e o Riacho Fundo II. <span style="color: rgb(51,81,95);background-color: rgb(241,241,241);font-family: Source Sans Pro;"> </span>O Parque foi criado com o objetivo de garantir a diversidade biológica da fauna e flora locais, preservando o patrimônio genético e a qualidade dos recursos hídricos disponíveis. A nascente do córrego Riacho Fundo nasce dentro do parque, conta com a presença de veredas, campo de murundus, riacho e várias espécies vegetais do cerrado, dentre eles frondosas copaíbas e embiruçus. Conta com sede administrativa, quadra de esporte, rampas de skate (300 e 600m), trilha ecológica 3km, coorpervia (1,5km) e ciclovia (1km) que circulam a área recreativa do parque, além de parquinho para crianças e praça de convivência.\r\nPossui diversos projetos junto a comunidade: Projeto Parque Educador (atendimento de alunos das escolas públicas); Viveiro de mudas do cerrado para recuperação de áreas degradadas; canteiro de plantas medicinais (Projeto Conexão Verde: mudas para comunidade, identificação de plantas arbóreas e rodas de conversa);.</p>	1	010100002042120000E8D167B1370448C0634750240AC62FC0	Entrada franca	Aberto todos os dias das 6h às 18h	Riacho Fundo I e  Riacho Fundo II	Parque Ecológico Riacho Fundo
