79	2018-10-06 18:50:41+00	\N	Estação Ecológica Águas Emendadas - Esecae	Estação Ecológica	Estação Ecológica		(DECRETO N.º 771, DE 12 DE AGOSTO DE 1968\nCria a Reserva Ecológica de “Águas Emendadas”, e dá outras providências). É uma das mais importantes reservas naturais do Distrito Federal, onde ocorre o fenômeno único da união de duas grandes bacias da América Latina, a Tocantins/Araguaia e a Platina, em uma Vereda de 6 km de extensão. Essa característica faz dela um dos acidentes geográficos de maior expressão existentes no território nacional: as águas que ali brotam correm em duas direções opostas. A estação ecológica engloba também a Lagoa Bonita, nascente do ribeirão Mestre D’Armas e local de relevante beleza e importância ambiental. Sua área de Cerrado, praticamente intacta, abriga fauna ameaçada de extinção, como a anta, a suçuarana, o tamanduá, o lobo-guará, entre outros, sendo de grande importância para a realização de pesquisas científicas. Por se tratar de uma Unidade de Conservação de Proteção Integral, as visitas são restritas e apenas ocorrem de forma guiada.\n_________________________________________________________________________________________________________________________________\n\nLista das aves observadas:\n1.Andorinha-doméstica-grande;\n2.Andorinhão-do-buriti;\n3.Andorinha-pequena-de-casa;\n4.Anu-preto;\n5.Arapaçu-grande;\n6.Arara-caninde;\n7.Ariramba-de-cauda-ruiva;\n8.Asa-branca;\n9.Ananaí;\n10.Balança-rabo-de-máscara;\n11.Beija-flor-de-bico-curvo;\n12.Beija-flor-de-garganta-verde;\n13.Beija-flor-de-orelha-violeta;\n14.Beija-flor-tesoura;\n15.Beija-flor-tesoura-verde;\n16.Bem-te-vi;\n17.Besourinho-de-bico-vermelho;\n18.Biguá;\n19.Caneleiro-preto;\n20.Carcará;\n21.Chifre-de-ouro;\n22.Choca-de-asa-vermelha;\n23.Chorão;\n24.Choró-boi;\n25.Codorna;\n26.Coleiro-do-brejo;\n27.Coró-coro;\n28.Corruíra;\n29.Corujaburaqueira;\n30.Curicaca;\n31.Currutie;\n32.Ferreirinho-relógio;\n33.Figuinha-de-rabo-castanho;\n34.Fogo-apagou;\n35.Freirinha;\n36.Gal