101	2021-06-12 22:02:55.530844+00	\N	ARIE da Vila Estrutural	\N	Área Protegida - Unidade de conservação de uso sustentável		<p>É uma área ambientalmente sensível e socialmente complexa, tendo como vizinhos o Parque Nacional de Brasília e o aterro controlado do Jóquei, conhecido como “lixão da Estrutural”. A criação da Unidade de Conservação regulamenta e permite um maior controle dos usos admissíveis e atividades desenvolvidas na ARIE, de modo a propiciar a conservação e a proteção dos recursos bióticos e abióticos existentes. Funciona na proteção do parque Nacional de Brasília, integrando sua zona de amortecimento, como uma zona tampão. Consta em sua criação a finalidade de impedir ocupação urbana que possa interferir na conservação do Parque Nacional de Brasília.</p>	\N	0101000020421200004DD6AED782FE47C0BB6246787B8C2FC0	\N	\N	\N	\N
102	2021-06-12 22:13:05.059407+00	\N	ARIE do Córrego Cabeceira do Valo	\N	Área Protegida - Unidade de conservação de uso sustentável		<p>Também localizada nas proximidades da Cidade Estrutural, a ARIE do Córrego Cabeceira do Valo compartilha as mesmas características socioambientais e geográficas da ARIE Vila Estrutural, e tem como objetivo a proteção e recuperação da Área de Preservação Permanente – APP do Córrego Cabeceira do Valo. Em seus 44 hectares são desenvolvidas atividades rurais produtivas cuja regulação de uso, através do estabelecimento de planos de utilização em conformidade com as&nbsp; diretrizes &nbsp;da UC, está entre os objetivos da unidade.</p>	\N	0101000020421200003E2967618C0048C065A9F57EA38D2FC0	\N	\N	\N	\N
