30	2018-10-06 18:50:41+00	\N	Parque Ecológico do Cortado	Uso Sustentável	Uso Múltiplo		<p>Situado na região central de Taguatinga, este parque abriga o Ribeirão do Cortado, que contém várias cachoeirinhas. Por ser um local onde brotam nascentes, foi construída uma passarela suspensa que proporciona condições ideais para a contemplação e observação da natureza. No parque está sendo construído o primeiro Hospital Veterinário Público do DF.</p>\n<p><br> São objetivos da criação do<strong> Parque de Uso Múltiplo do Cortado</strong>(DECRETO Nº 29.118, DE 05 DE JUNHO DE 2008):<br>I - conservar, proteger e recuperar as áreas verdes, nativas, exóticas ou restauradas, promovendo sua revegetação de forma integrada; <br>II - conservar, proteger e recuperar os recursos hídricos: nascentes, veios d’água e curso natural do Córrego Cortado e de suas margens;<br>III - incentivar e estimular o desenvolvimento de atividades de pesquisa, estudos e monitoramento ambiental;<br>IV - estimular o desenvolvimento da educação ambiental e de atividades culturais, esportivas, recreativas e de lazer em contato harmônico com a natureza.<br><br>Lista das aves observadas:<br>1.Anu-branco;<br>2.Ariramba;<br>3.Baiano;<br>4.Balança-rabo-de-máscara;<br>5.Beija-flor-tesoura;<br>6.Beija-flor-tesoura-verde;<br>7.Bem-te-vi;<br>8.Bem-te-vi-rajado;<br>9.Bico-chato-de-orelha-preta;<br>10.Cambacica;<br>11.Caneleiro-de-chapéu-preto;<br>12.Carcará;<br>13.Chorozinho-de-bico-comprido;<br>14.Chupim;<br>15.Corruíra;<br>16.Curicaca;<br>17.Ferreirinho-relógio;<br>18.Garrinchão-de-barriga-vermelha;<br>19.Gavião-carijó;<br>20.Guaracava-cinzenta;<br>21.João-de-barro;<br>22.João-porca;<br>23.Juruviara (chivi/diversus);<br>24.Neinei;<br>25.Peitica;<br>26.Periquito-de-encontro-amarelo;<br>27.Pica-pau-verde-barrado;<br>28.Picapauzinho-escamoso;<br>29.Pitiguari;<br>30.Pula-pula (hypoleucus);<br>31.Rabo-branco-acanelado;<br>32.Rolinha;<br>33.Sabiá-branco;<br>34.Sabiá-laranjeira;<br>35.Sabiá-ferreiro;<br>36.Sabiá-poca;<br>37.S